import React, { useEffect, useState } from "react";
import { useNavigate } from 'react-router-dom'

import '../styles/price.scss'

const Price = () => {
    const navigate = useNavigate()
    const [services, setServices] = useState(null)

    const handleNavigate = (e) => {
        window.scrollTo({
            top: 0,
            left: 0
        })
        navigate(`${e.target.id}`)
    }

    useEffect(() => {
        setServices([
            {category_id: '1', name: 'Комплексная консультация специалистов (первичная)', text: 'Количество специалистов зависит от запроса. Обследование проводится в присутствии родителей, в игровой форме.\nДлительность  1 час.', price: '2000 ₽'},
            {category_id: '1', name: '', text: '', price: '1500 ₽'},
            {category_id: '1', name: '', text: '', price: '2500 ₽'},
            {category_id: '2', name: '', text: '', price: '2000 ₽ / час'},
            {category_id: '2', name: '', text: '', price: '2000 ₽'},
            {category_id: '2', name: '', text: '', price: '1700 ₽'},
            {category_id: '2', name: '', text: '', price: '23000 ₽'},
            {category_id: '2', name: '', text: '', price: 'от 5000 ₽'},
            {category_id: '3', name: '', text: '', price: '50 мин – 1500 ₽ / 30 мин – 1200 ₽'},
            {category_id: '3', name: '', text: '', price: 'Индивидуальное занятия: 50 мин – 1400 ₽ / 30 мин – 1100 ₽\nГрупповое занятие: 50 мин – 700 ₽ / чел.'},
            {category_id: '4', name: '', text: '', price: 'Цена по согласованию'},
        ])
    }, [])

    return (
        <section className="ContentContainer">
            <div className="TopLink">
                <div className="Link" id="/" onClick={handleNavigate}>Главная</div>
                <div>&nbsp;/ О нас</div>
            </div>
            <div className="AboutContainer PB0">
                <div className="AboutPanel">
                    <h1>Прайс-лист на услуги</h1>
                    {services ?
                        <>
                            <h2>Диагностика и консультации специалистов</h2>
                        </>
                        :
                        <div className='LoaderBox'>
                            <span class="Loader"></span>
                        </div>
                    }
                </div>
            </div>
        </section>
    )
}

export default Price;
